import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div>
      <div className="container-fluid footer">
        <div className="row">
          <div className="footer_up">
            <div className="col-lg-4 col-sm-2 footer_left">
              <div className="footer_img">
                <img src="./images/logo.jpg" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
